import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';  // Import Routes, Route, dan Link
import Home from './components/Home';

function App() {
  return (
    <div>
      <nav className="p-6 bg-teal-700">
        <ul className="flex space-x-6">
          <li><Link to="/home" className="text-white">Home</Link></li>
        </ul>
      </nav>

      <div className="p-6">
        <Routes>
          <Route path="/" element={<Home />} />  {/* Definisikan rute ke Home */}
        </Routes>
      </div>
    </div>
  );
}

export default App;
